export default {
    props: ['object'],
    methods: {
      close: function(){
        if (this.object == 'render_card'){
        store.commit('card')
        }
        else {
          store.commit('image');
          setTimeout(function(){
            document.body.style.overflow = 'auto';
          }, 300)
        }
      }
    }
}
